import React from "react"
import PropTypes from "prop-types"

class Navbar extends React.Component {
  handleClick = () => {
    console.log('значение this:', this);
  }

  render () {
    return (
      <div>
        <button onClick={this.handleClick}>
        Sign In
      </button>);
        <button>
          Sign up
        </button>

      </div>
    );
  }
}

export default Navbar
